import configConstants from '@config/constants'

const {
  API: { baseURL, timeout }
} = configConstants

const fff = { name: 'Divine', age: '29' }
const vvv = JSON.stringify(fff)
const hhh = vvv.split(':')

const buuks = 'hello'

console.log('buukssssss', hhh)

export default buuks
